import React from 'react'

function Table({countries}) {
    return (
        <div className="table">
            {countries.map(({country, cases}) => {
              <tr>
                  <td>{country}</td>
                  <td>
                      <stron>{cases}</stron>
                  </td>
              </tr>
            })}
        </div>
    )
}

export default Table
